const containerStyle = {
    display: 'flex',
    alignItems: 'center',
    gap: '16px'
}

const starContainerStyle = {
    display: 'flex',
    gap: '4px'
}

export default function StarRating() {
    return (
        <div style={containerStyle}>
            <div>
                {Array.from({ length: 5 }, (_, i) => <span>Stars{i + 1}</span>)}
            </div>
            <p>10</p>
        </div>
    )
}
